import { FaLinkedin, FaGithub } from 'react-icons/fa'; // Import the Font Awesome icons
import '../styles/LinkBar.css';


const LinkBar: React.FC = () => {
  return (
    <div>
      <nav>
      <ul>
        <li>LinkedIn</li>
        <li>GitHub</li>
        <li>Resume</li>
      </ul>
      </nav>
    </div>
  );
};

export default LinkBar;
